webpackJsonp([0xd6508d71cf0c5000],{"./node_modules/json-loader/index.js!./.cache/json/kramdown-syntax-cheatsheet.json":function(e,a){e.exports={data:{site:{siteMetadata:{title:"Jeffry.in",author:"Jeff Wainwright"}},markdownRemark:{id:"/Users/jwainwright/Dropbox/me/git-docs/yowainwright.github.io/src/pages/2015-09-11-jekyll-kramdown-cheatsheet.md absPath of file >>> MarkdownRemark",html:'<p>Using <a href="http://daringfireball.net/projects/markdown/">markdown</a> is a quick way to set up a <em>semi-formatted</em> post or page. It can really bring a page to life quickly &#x26; help to visually define the layout of text. This site is built with <a href="http://jekyllrb.com">jekyll</a> so I’m using <a href="http://kramdown.gettalong.org/">kramdown</a>, a version of markdown.</p>\n<h2>Below is a useful cheatsheet, mainly for me.</h2>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>**Bold**\n</code></pre>\n      </div>\n<p><strong>Bold</strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>_Italics_\n</code></pre>\n      </div>\n<p><em>Italics</em></p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>`Monospaced`\n</code></pre>\n      </div>\n<p><code>Monospaced</code></p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>> Quoted text\n</code></pre>\n      </div>\n<blockquote>\n<p>Quoted text</p>\n</blockquote>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>[link](http://makandra.com/)\n</code></pre>\n      </div>\n<p><a href="http://makandra.com/">link</a></p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>![image alt text](//placekitten.com/g/900/600)\n</code></pre>\n      </div>\n<p></p>\n<p>If you want to enforce a line break,\\\nyou need to use two backslashes.</p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code># Headline\n</code></pre>\n      </div>\n<h1>Headline</h1>\n<p>Lorem ipsum…</p>\n<p>Horizontal Rule Below</p>\n<hr>\n<p>Code</p>\n<p>wrap a code block with ‘`<code></code>’</p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>def foo\n  "hello!"\nend\n</code></pre>\n      </div>\n<p>Unordered List</p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code>\\* Unordered List Item\n</code></pre>\n      </div>\n<ul>\n<li>Unordered List Item 1</li>\n<li>Unordered List Item 2</li>\n</ul>\n<p>Ordered List</p>\n<ol>\n<li>Ordered List Item 1</li>\n<li>Ordered List Item 2</li>\n</ol>\n<p>HTML</p>\n<p class="html-example">This text is wrapped by a div with an html class</p>',frontmatter:{featured_image:null,meta:"Kramdown Syntax Cheatsheet",title:"Jekyll Kramdown Syntax Cheatsheet",date:"September 11, 2015"}}},pathContext:{path:"/kramdown-syntax-cheatsheet/"}}}});
